  \"2016-11-10T08:44:20.055406\",\n\t\"name\": \"regularly-scheduled-tow-away-zone-gis-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains locations and schedules
  of regular tow-away zones which apply at the blockface-level in San Francisco. It
  does not include temporary street closures which could result in towing. The dataset
  contains:Geospatial information for blockfaces with known tow schedulesTow schedules
  with starting and ending hours and days applicableAddress ranges for the blockface
  segmentThe centerline identifier of the street segment on which the blockface occursNotes,
  if known, to enhance the information about the regulation. rnrnThis dataset was
  compiled in October and November of 2011. It reflects legislated changes through
  November 1, 2011. It is at least 95% accurate and may not include all blockface-level
  tow-away zones with regular, weekly schedules. Please email corrections or discrepancies
  to info@sfpark.org. Always look for signage near your parking space and follow posted
  regulations to avoid parking citations and possible towage. See http://sfpark.org/resources/regularly-scheduled-tow-away-zone-gis-data/
  for more.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
